function Pavani(props){
    return(
        <div>
            <p>
                name:{props.name}<br/>
                city:{props.city}<br/>
                age:{props.age}<br/>
                state:{props.state}
            </p>
        </div>
    )
}
function Prop(){
    return(
        <div>
            <Pavani name="raghav"city="chittoor" age="46" state="andhra"/>
        </div>
    )
}
export default Prop;
